import React from 'react';
import {Navbar, Nav } from 'react-bootstrap'
import {NavLink} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css';
import ProfileImage from '../../images/tien_nguyen_150px_small.png';


const Navibar = () => {
    return (
        <nav>
          <Navbar bg="dark" variant="dark">
            <Navbar.Brand href="#home"><img src = {ProfileImage} alt ="NavLogo"/></Navbar.Brand>
            <Nav className="mr-auto">
              <NavLink className="nav-link" to="/" exact={true}>Home</NavLink>
              <NavLink className="nav-link" to="/portfolio">Portfolio</NavLink>
            </Nav>
          </Navbar>          
          <div><img src = {ProfileImage} alt ="NavLogo"/></div>
        </nav>
        
    )
}

export default Navibar;
